import './App.css';

function App() {
  return (
    <>
    <div className="container">
      <form className="form">
        <input type="text" className="input" placeholder="Full-Name"></input>
        <input type="text" className="input" placeholder="Roll-no."></input>
        <input type="text" className="input" placeholder="Email"></input>
        <input type="text" className="input" placeholder="Ratings"></input>
        <button type="submit" className="submit"></button>
        </form>
    </div>
    </>
  );
}

export default App;
